struct JobId
{
    ::std::string id;
    ::std::string batch;

    bool operator==(const JobId& rhs_) const
    {
        if(this == &rhs_)
        {
            return true;
        }
        if(id != rhs_.id)
        {
            return false;
        }
        if(batch != rhs_.batch)
        {
            return false;
        }
        return true;
    }

    bool operator<(const JobId& rhs_) const
    {
        if(this == &rhs_)
        {
            return false;
        }
        if(id < rhs_.id)
        {
            return true;
        }
        else if(rhs_.id < id)
        {
            return false;
        }
        if(batch < rhs_.batch)
        {
            return true;
        }
        else if(rhs_.batch < batch)
        {
            return false;
        }
        return false;
    }

    bool operator!=(const JobId& rhs_) const
    {
        return !operator==(rhs_);
    }
    bool operator<=(const JobId& rhs_) const
    {
        return operator<(rhs_) || operator==(rhs_);
    }
    bool operator>(const JobId& rhs_) const
    {
        return !operator<(rhs_) && !operator==(rhs_);
    }
    bool operator>=(const JobId& rhs_) const
    {
        return !operator<(rhs_);
    }
};

